import React from 'react';
import ReactDOM from 'react-dom';
import 'antd/dist/antd.css';
import './index.css';
import { Layout, Menu, Breadcrumb } from 'antd';
import { Button } from 'antd';
import { Row, Col } from 'antd';
import {
    DesktopOutlined,
    PieChartOutlined,
    FileOutlined,
    TeamOutlined,
    UserOutlined,
} from '@ant-design/icons';

const { Header, Content, Footer, Sider } = Layout;
const { SubMenu } = Menu;
function App() {
  return (
      <Layout >
          <Header style={{color:"white", justifySelf: 'center'}}>
              Tobi pizda
          </Header>
          <Layout >
              <Menu theme="dark" defaultSelectedKeys={['1']} mode="inline">
                  <Menu.Item key="1" style={{ display: 'inline-flex', justifyContent: 'center'}}>
                      BTC
                  </Menu.Item>
                  <Menu.Item key="2" style={{ display: 'inline-flex', justifyContent: 'center'}}>
                      Ripple
                  </Menu.Item>
                  <Menu.Item key="3" style={{ display: 'inline-flex', justifyContent: 'center'}}>
                      Eth
                  </Menu.Item>
                  <Menu.Item key="4" style={{ display: 'inline-flex', justifyContent: 'center'}}>
                      Azaza
                  </Menu.Item>
              </Menu>
          </Layout>
          <Layout>
              <Row style={{ display: 'inline-flex', justifyContent: 'center'}}>
                  <Col>
                      <Button>Up</Button>
                  </Col>
                  <Col>
                      <Button>Down</Button>
                  </Col>
              </Row>

          </Layout>
          <Footer style={{ display: 'inline-flex', justifyContent: 'center'}}>
              Tobi Pizda
          </Footer>
      </Layout>
  );
}

export default App;
